Silk Blaze【シルクブレイズ】<br>
20アルファード/ヴェルファイア…ANH[GGH]20W/25W　<br>
年式…H20.05～<br><br>

SilkBlaze 超美艶クロームメッキシフトノブ<br><br>

※シフトノブは純正と同程度の深さに合わせてください。締め続ければ下の方まで締まりますが、アダプターとシフトノブに隙間が生じる場合があります。<br><br>

※取付方法、構造は純正シフトノブと同様です。<br><br>

※樹脂タイプとなりますので上から押さえるように回すことで樹脂がネジ切られます。<br>







